import styled from "styled-components";

const SelectContainer = styled.div`
  display: flex;
  margin: 0 auto;
  width: 100%;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
  -webkit-flex-direction: row;
  -ms-flex-direction: row;
  flex-direction: row;
  -webkit-box-flex: 1;
`;

export default SelectContainer;
